import React from 'react'
import ReactTyped from "react-typed";
import dancingDuckGif from '../../images/dancing-duck-gif.gif';

import './Landing.css'

const Landing = () => {
    const headingStrings = ["an engineer.", "a sewist.", "a problem solver.", "a ball of sunshine.", "a huge fan of ducks!!!"];
    return (
        <div>
            <h1 className='heading-animation'>
                Hi! My name is Elangeni and I am<br /> {" "}
                <ReactTyped strings={headingStrings} typeSpeed={100} />
            </h1>
            <img src={dancingDuckGif} alt="Dancing Duck" className="gif" />
            <div className="button-container">
                <h2 className="button-prompt">Wanna see cool stuff?</h2>
                <button className="landing-button">Yes!</button>
                <button className="landing-button">No, but actually yes</button>
            </div>
        </div>
    )
}

export default Landing
